export default function Plans() {
  return (
      <div className='py-[100px]'>
          <div className='grid grid-cols-3 border border-black'>
              <div className='shadow h-[300px]'></div>
              <div className='shadow h-[300px]'></div>
              <div className='shadow h-[300px]'></div>
              Plans
          </div>
      
    </div>
  )
}
